import styled from 'styled-components';

export const ProfileContainer = styled.div`
    width: 100%;
    margin-top: 100px;
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
`;

export const CardContainer = styled.div`
    width: 1100px;
    height: 500px;
    display: flex;
    border-radius: 26px;
    position: relative;
    border: 2px solid #DA4264;
    background-color: rbga(246, 39, 39, 0.2);
    backdrop-filter: blur(10px);
`;

export const SideImageContainer = styled.div`
    display: flex;
    flex: 1;
    left: 50px;
    top: 80px;
    position: relative;
    background: rgb(251,133,59);
    background: linear-gradient(274deg, rgba(251,133,59,1) 0%, rgba(250,54,97,1) 57%, rgba(250,54,97,1) 57%);
`;
